    private boolean hasGroupsSizeX_attemptTwo(int[] deck) {

        Map<Integer, Integer> m = new HashMap<>();
        Set<Integer> divisors = new HashSet<>(Arrays.asList(2, 3, 5, 7));

        Arrays.stream(deck).forEach(v -> m.put(v, (1 + m.getOrDefault(v, 0))));

        m.forEach((k, v) -> divisors.removeIf(div -> v % div != 0));

        return divisors.size() > 0;
    }


    private boolean hasGroupsSizeX_firstAttempt(int[] deck) {
        if (deck.length <= 1)
            return false;
        Map<Integer, Integer> m = new HashMap<>();
        int max = 0;
        for (int v : deck) {
            int i = 1 + m.getOrDefault(v, 0);
            m.put(v, i);
            if (max < i)
                max = i;
        }

        int maxDiv = maxDivisor(max);
        int maxDiv2 = max % 2;
        int maxDiv3 = max % 3;

        for (Map.Entry<Integer, Integer> e : m.entrySet()) {
            int v = e.getValue();
            if (v == 1)
                return false;
            if (v % maxDiv != 0 && (maxDiv2 != v % 2) && (maxDiv3 != v % 3))
                return false;
        }
        return true;
    }

    private int maxDivisor(int v) {
        int divisor = 2;
        for (int i = 2; i < 8; i++)
            if (v % i == 0)
                divisor = i;
        return divisor;
    }

